import './App.css'; 
import {BrowserRouter,Routes,Route} from "react-router-dom"
import MyApp from "./Containers/MyApp"
import Home  from "./Containers/Home"
function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route exact path="/" component={Home}/>
      </Routes>
    </BrowserRouter>
  );
}
export default App;
